            const popupContents = `
<div><b>${properties.CALLSIGN}</b></div>
<div>${properties.FREQ} MHz</div>
<div>${properties.SITENAME}, ${properties.SITESTATE}</div>
${radioPlayBtn}`

            const popup = new mapboxgl.Popup({ className: 'alertPopup', maxWidth: '1000' })
